import React, { useState } from 'react';
import styled from 'styled-components'
import { LinkButtonSmall } from '../styles/Link'

var HeaderContainer = styled.header`
    display: flex;
    // margin-left: 10em;
    // width: 100%;

    box-shadow: 0 1px 6px 0 rgba(32,33,36,.28);
    height: 72px;
    justify-content: flex-end;
    `;

var ButtonBox = styled.div`
    // margin: 28px ;
    width: 300px;
    heigth: 180px;
    background-color: green;

`;

var ButtonBoxSpace = styled.div`
    width: 50px;
    heigth: 180px;

    background-color: red;
    z-index : 100;
`;

var Header = () => {
    // Declare a new state variable, which we'll call "count"
    //   const [count, setCount] = useState(0);

    return (
        <HeaderContainer>
            {/* <ButtButtonBoxSpace/> */}
            <ButtonBoxSpace />
            <ButtonBox>
            <div style={{ width: "30px", backgroundColor: "yellow" }}></div>
                {/* <LinkButtonSmall to="csv">Csv Generation</LinkButtonSmall> */}
                <ButtonBoxSpace />
                {/* <LinkButtonSmall to="config">Config Generation</LinkButtonSmall> */}
            </ButtonBox >
        </HeaderContainer>
    );
}

export { Header };
